import React, {Component} from 'react';
import TickerDetail from './TickerDetail';


class ExchangeDetail extends Component {
    constructor(props){
        super(props);

        this.state = {
            buy_volume: 0,
            sell_volume: 0,
            total_volume: 0,
            actions_count: 0,
            participation: 0
        };    
    }


    // componentDidUpdate(prevProps){
    //     if (this.props.exchange.buy_volume !== prevProps.exchange.buy_volume) {
    //         this.setState({
    //             buy_volume: this.props.exchange.buy_volume,
    //             total_volume: this.props.exchange.buy_volume + this.state.total_volume,
    //             participation: Math.round((this.state.total_volume/this.props.total_volume)*10000)/100,
    //             actions_count: this.props.exchange.stocks.length
    //         })

    //     }
    //     if (this.props.exchange.sell_volume !== prevProps.exchange.ell_volume) {
    //         this.setState({
    //             sell_volume: this.props.exchange.sell_volume,
    //             total_volume: this.props.exchange.sell_volume + this.state.total_volume,
    //             participation: Math.round((this.state.total_volume/this.props.total_volume)*10000)/100,
    //             actions_count: this.props.exchange.stocks.length
    //         })
    //     }

    // }

    render(){
        return (
            <div className="col-md-12">
                <h1>{this.props.exchange.name}</h1>
                <div className="exchange_info">
                    <table>
                        <tr>
                            <th>Volumen de compra</th>
                            <th>Volumen de venta</th>
                            <th>Volumen total</th>
                            <th>Cantidad de acciones</th>
                            <th>Participaci√≥n de mercado</th>

                        </tr>
                        <tr>
                            <th>{this.props.exchange.buy_volume}</th>
                            <th>{this.props.exchange.sell_volume}</th>
                            <th>{this.props.exchange.buy_volume + this.props.exchange.sell_volume}</th>
                            <th>{Math.round((this.state.total_volume/this.props.total_volume)*10000)/100}</th>
                            <th>{this.state.participation}%</th>

                        </tr>
                    </table>

                </div>
                <div>
                    {this.props.exchange.stocks.map(company => {
                        return(
                            <TickerDetail
                                key = {company.company}
                                ticker = {company}
                                prueba = {this.props.prueba}
                                big = {this.props.bigs[company.ticker]}
                                small = {this.props.smalls[company.ticker]}
                                last = {this.props.lasts[company.ticker]}
                                volume = {this.props.volume[company.ticker]}
                                // buy_change = {this.props.buy_change}
                                // sell_change = {this.props.sell_change}
                            /> 
                        )
                    })}
                </div>
            </div>
        );
    }
}

export default ExchangeDetail;
